import React from "react";
import ProductSimilarTemizlik from "../Components/product/ProductSimilarTemizlik";
import TemizlikCamasirSuyuTableti from "../Components/product/TemizlikCamasirSuyuTableti";

function TemizlikCamasirSuyuTabletiPage() {
  return (
    <>
      <TemizlikCamasirSuyuTableti />
      <ProductSimilarTemizlik />
    </>
  );
}

export default TemizlikCamasirSuyuTabletiPage;
